  false,\n\t\"url\": null,\n\t\"notes\": \"Master plan for the recreational and public
  use development of Fort Niobrara National Wildlife Refuge, near Valentine, Nebraska.
  This plan outlines the development and management required to provide public enjoyments
  from the bison, elk, and related prairie species on the refuge. The plan discusses
  refuge history, operational criteria and costs, facilities and development, and
  provides data relating to refuge geology, soils, hydrology, easements, and right-of-ways.
  \ Detailed figures are provided for the existing refuge in  1966, proposed headquarters,
  offices, visitor center, and slaughterhouse.\",\n\t\"license_title\": \"License
